import React from 'react'
import './skills.scss'

function Skills() { 
    return ( 
        <div className="container skillContainer"> 
            <ul> 
                <li> <img src="" alt=""/> </li> 
                <li>Competitive Problem Solving</li> 
                <li>Web development</li> 
                <li>React</li> 
                <li>Redux</li> 
            </ul> 
            
        </div> 
    ) 
} 

export default Skills;
